/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import '../share.css';
import Item from './ListItem';
export default class List extends React.Component {
    render(){
        let {onClick} = this.props;
        return(
            <div className="cm-item" onClick={()=>onClick()}>
                {this.props.children}
        </div>
        )
    }
}
List.Item = Item;
